import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import SingleProduct from "../components/SingleProduct";
import Single from "../newSingle"
import ProductList from "../components/ProductList";
import { useLocation } from "react-router-dom";


const createSingleproduct = (single) => {
    return (
        <div>
            <Wrapper         className="swrapper">
                <Div className="main1">
                    <Div className="smallImg">
                        <Img className="sideImg" src={single.img1} />
                        <Img className="sideImg" src={single.img2} />
                        <Img className="sideImg" src={single.img3} />
                        <Img className="sideImg" src={single.img4} />
                        <Img className="sideImg" src={single.img5} />
                    </Div>
                    <Div className="mainImg">
                        <Div>
                            <Img className="mainProduct" src={single.imgURL} />
                        </Div>
                        <Div className="btn-single">
                            <Button className="btn btns">Buy Now</Button>
                            <Button className="cart-btn btn btns">Add to Cart</Button>
                        </Div>
                    </Div>
                </Div>
                <Div className="main2">
                    <H2 className="productName">
                        {single.name}
                    </H2>
                    <P className="productDisc">{single.discription}</P>
                    <H3 className="productPrice">{single.email}</H3>
                </Div>
            </Wrapper>
            // key = {single.id}
            // name = {single.name}
            // imgURL = {single.imgURL}
            // email = {single.email}
            // discription = {single.discription}
            // img1 = {single.img1URL}
            // img2 = {single.img2URL}
            // img3 = {single.img3URL}
            // img4 = {single.img4URL}
            // img5 = {single.img5URL}
        </div>
    );
}   

const SingleProductpage = () => {



    return (<div>
    <Navbar />
    <div className="scontainer">
        {Single.map(createSingleproduct)}
    </div>
    <ProductList />
    <Footer />
    </div>
        
    );
}
export default SingleProductpage;
